import React, { Component } from 'react';

class Nav extends Component {
  render() {
    return(
      <nav className='buttons col-12'>
        <ul className='col-12'>
          <li><span class="iconify" data-icon="ant-design:plus-square-filled" data-inline="false"></span></li>
          <li><span class="iconify" data-icon="whh:foodtray" data-inline="false"></span></li>
        </ul>
      </nav>
    )
  }
}

export default Nav;
